pragma solidity >=0.8.0;



import { LibERC2771Recipient } from "./LibERC2771Recipient.sol";  
/**
 * @title The ERC-2771 Recipient Base Abstract Class - Implementation
 *
 * @notice Note that this contract was called `BaseRelayRecipient` in the previous revision of the GSN.
 *
 * @notice A base contract to be inherited by any contract that want to receive relayed transactions.
 *
 * @notice A subclass must use `_msgSender()` instead of `msg.sender`.
 */
contract iERC2771Recipient {
 
    /*
     * Forwarder singleton we accept calls from
     */
     
    

    function _getTrustedForwarder() internal  view returns (address forwarder){
        return LibERC2771Recipient.__getTrustedForwarder();
    }

    function _setTrustedForwarder(address _forwarder) internal {
        LibERC2771Recipient.__setTrustedForwarder(_forwarder); 
    }
  
  
    function _isTrustedForwarder(address forwarder) internal  view returns(bool) {
        return LibERC2771Recipient._isTrustedForwarder(forwarder);
    } 

    
    function msgSender() internal  view returns (address ret_) {
        ret_ = LibERC2771Recipient._msgSender();
    }
    
    function msgData() internal  view returns (bytes calldata ret_) {
        ret_ = LibERC2771Recipient._msgData();
    }
}","keccak256":"0x0a097bedc1831e582bf1b64b8406b71a3441ed6f9d09b12874821b94d3ce9a88","license":"MIT"},"contracts/facets/Ownership/LibOwnership.sol":{"content":"pragma solidity ^0.8.0;



library LibOwnership {
bytes32 constant OWNERSHIP_STORAGE_POSITION = keccak256("diamond.ownership.storage");
uint24 constant MIGRATION_TRANSITION_LOCK_TIMESPAN = 259200; // 3 days

struct OwnershipStorage{
    address ecosystemOwner;
    address registry;
    Migration migration;
}
struct Migration{
    bool isMigrating;
    uint32 initiationTimestamp;
}

function ownershipStorage() internal pure returns (OwnershipStorage storage os) {
        bytes32 position = OWNERSHIP_STORAGE_POSITION;
        assembly {
            os.slot := position 
        }
    }

    event OwnershipTransferred(address indexed previousOwner, address indexed newOwner);

    /**
        Should never be used outside of iOwnership.sol (exception for the initial diamond constructor)
        @notice Sets the owner of this ecosystem
        @param _newEcosystemOwner  new ecosystem owner 
     */
    function _setEcosystemOwner(address _newEcosystemOwner) internal {
        OwnershipStorage storage os = ownershipStorage();
        address previousOwner = os.ecosystemOwner;
        os.ecosystemOwner = _newEcosystemOwner;
        emit OwnershipTransferred(previousOwner, _newEcosystemOwner);
    }

    function _ecosystemOwner() internal view returns (address ecosystemOwner_) {
        ecosystemOwner_ = ownershipStorage().ecosystemOwner;
    }

    function _setRegistry(address _registry) internal {
        OwnershipStorage storage os = ownershipStorage();
        os.registry = _registry;
    }
    function _getRegistry() internal view returns (address registry_) {
        OwnershipStorage storage os = ownershipStorage();
        registry_ = os.registry;
    }
    
    
